const arraysEqual = (a, b) => {
  if (a === b) return true;
  if (a == null || b == null) return false;
  if (a.length !== b.length) return false;

  for (var i = 0; i < a.length; ++i) if (!b.includes(a[i])) return false;

  return true;
};

export default arraysEqual;
